Job Status </b></span><br><span>[JOBSTATUS]</span><br><br><span><b>Due Date</b></span><br><span>[DUEDATE]</span><br><br>\r\n												</div>\r\n												<div>\r\n													<span><b>Click here to accept the job</b></span><br><br>\r\n													<span>[ACCEPTLINK]</span><br><br>\r\n													<span><b>Click here to reject the job</b></span><br><br>\r\n													<span>[REJECTLINK]</span><br><br>\r\n												</div>\r\n												<div><span> </span></div>\r\n												\r\n											</td>\r\n										</tr>\r\n										<tr>\r\n											<td style=\"padding: 5px;background-color: #efefef;border-top: 1px solid #b5b5b5;\">\r\n												<center>\r\n													<div style=\"text-align: left;\"><span>For more information, visit us\r\n															at <a style=\"color: #000000;\" href=\"https://www.spellup.no\"><u>www.spellup.no</u></a></span>\r\n													</div>\r\n													<div style=\"text-align: left;\"><span style=\"color: #ffffff;\"><u style=\"color: rgb(255, 255, 255);\"><br></u></span></div>\r\n													<div> </div>\r\n													<div style=\"text-align: left;\"><span><em>This email and any attachments to it may be confidential and are intended solely for the use of the individual to whom it is addressed. If you are not the intended recipient of this email, you must neither take any action based upon its\r\n																contents, nor copy or show it to anyone. If you have received this transmission in error, please use the reply function to tell us and then permanently delete what you have received.</em></span></div>\r\n													<div> </div>\r\n													<div> </div>\r\n												</center>\r\n											</td>\r\n										</tr>\r\n									</tbody>\r\n								</table>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 'Job Request', 8, 1, 1, '2018-10-29 18:29:14', '2018-10-31 19:16:07'),
(12, 'Invoice to client', '<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge,chrome=1\">\n<meta name=\"format-detection\" content=\"telephone=no\"> <!-- disable auto telephone linking in iOS -->\n<title></title>\n<div><span style=\"font-family: Khmer UI,geneva;\">Hi!</span></div>\n<div>&nbsp;</div>\n<div><span style=\"font-family: Khmer UI,geneva;\">We are hereby sending our invoice [INVOICENO].</span><br><br></div>\n<div><span style=\"font-family: Khmer UI,geneva;\">Payment for this invoice is due by [PAYDUE].</span><br><br><span style=\"font-family: Khmer UI,geneva;\">Thank you!</span></div>\n<div>&nbsp;</div>', 'Invoice', 9, 1, 1, '2023-06-02 16:57:05', '2023-06-02 17:14:52'),
(13, 'Purchase Order (Email Content)', '<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\r\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge,chrome=1\">\r\n<meta name=\"format-detection\" content=\"telephone=no\"> <!-- disable auto telephone linking in iOS -->\r\n<title></title>\r\n\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">Hi [Name2]!</span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"> </span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">Thank you so much for helping us with this project!</span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"> </span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">Download the files you need for the project directly</span>:<br style=\"font-family: khmer ui,geneva; font-size: x-small;\" /><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">[DownloadURL]<br /></span></div>\r\n<div> </div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">Here is an overview of the project:</span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"> </span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">CLIENT:</span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">[IndirectCustomer]</span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"> </span></div>\r\n<div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">PROJECT:</span></div>\r\n<span style=\"font-family: khmer ui,geneva; font-size: x-small;\">[Item]</span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"> </span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">TASK:</span><br /><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">[JobService]</span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"> </span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">DEADLINE:</span><br /><span style=\"color: #ff0000; font-family: khmer ui,geneva; font-size: x-small;\">[DelivDeadline]</span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"> </span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">INSTRUCTIONS:</span></div>\r\n<div><span style=\"background-color: #ffff00; font-family: khmer ui,geneva; font-size: x-small;\">[JobComment]</span></div>\r\n<div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"> </span></div>\r\n<span style=\"font-family: khmer ui,geneva; font-size: x-small;\">WORD COUNT</span>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">[Fee]</span></div>\r\n<div> </div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">COMPANY TO INVOICE</span></span></div>\r\n<span style=\"font-family: khmer ui,geneva; font-size: x-small;\">BeConnected </span><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">[CompanyCodeShort]</span></span>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"> </span></div>\r\n<span style=\"font-family: khmer ui,geneva; font-size: x-small;\">PAYMENT</span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">[Total]</span>\r\n<div> </div>\r\n<div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">You can log into the job in Plunet by following the link below:</span></div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">[QuickJobLink]</span></div>\r\n</div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"> </span></div>\r\n</div>\r\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"> </span></div>\r\n<div> </div>', 'Purchase Order', 9, 1, 1, '2023-06-15 16:57:05', '2023-06-15 17:14:52');
