(15, 'Purchase Order (Attachment)', '<style>\n    .invoiceheader{\n    padding: 0 15px;;\n    }\n    .panel-heading-img{\n    float: right;\n    }\n    .address-title{\n    color: #808080;\n    }\n    .header-tr-border{\n    background-color: #bebebe;\n    }\n    table.table.table-bordered.table-condensed-second {\n    margin: 0px;\n    margin-top: 10px;\n    background-color: #d9d9d9 !important;\n    }\n    table.table.table-bordered.table-condensed-second tbody tr:nth-of-type(odd) td {\n    background: #d9d9d9 !important;\n    }\n    .table-condensed-second tbody tr {\n    background: #d9d9d9 !important;\n    }\n    .invoice {\n    width: 816px !important;\n    margin: 10px auto;\n    font-family: Khmer UI, serif;\n    margin-left: -15px;\n    }\n    .invoice .panel-heading {\n    background-color: #fff !important;\n    border-color: #fff !important;\n    }\n    .invoice .invoice-header {\n    padding: 25px 25px 15px;\n    }\n    .invoice .invoice-header h1 {\n    margin: 0;\n    }\n    .invoice .invoice-header .media .media-body {\n    font-size: 0.9em;\n    margin: 0;\n    }\n    .invoice .invoice-body {\n    border-radius: 10px;\n    padding-top: 25px;\n    padding-bottom: 25px;\n    background: #fff;\n    }\n    .invoice-content{\n    padding-left: 60px;\n    padding-right: 60px;\n    }\n    .dl-horizontal {\n    margin: 0;\n    line-height: 1.2;\n    padding: 12px;\n    } \n    .panel-body-image{\n    text-align: center;\n    }\n    .panel-body-image img {\n    width: 200px;\n    height: 100px;\n    }\n    .invoice-heading{\n    font-size: 18px;\n    }\n    .invoice-purchase-side dd {\n    display: flex;\n    justify-content: space-between;\n    padding: 5px;\n    }\n    .table-data-txt {\n    font-size: 14px;\n    }\n    tbody, td, tfoot, th, thead, tr {\n    border-style: unset !important;\n    }\n    .panel-body.table-payment-title {\n    margin-top: 50px;\n    }\n    .list-unstyled li a {\n    font-weight: 600;\n    text-decoration: none;\n    color: #000082;\n    }\n    .list-unstyled-one p , .list-unstyled-two {\n    list-style-type: none;\n    margin: 0px;\n    }\n    .list-unstyled-one a{\n    font-size:18px;\n    text-decoration: none;\n    }\n    .list-unstyled-two a {\n    font-size: 18px;\n    color: #000;\n    }\n    p.panel-title-footer-end {\n    text-align: end;\n    }\n    p.panel-titlefooter-start ,p.panel-title-footer-end {\n    padding-top: 10px;\n    }\n    .panel-default-btn{\n    float: right;\n    }\n    a.invoice-print-btn {\n    padding: 8px 20px;\n    border:1px solid #dee2e6;\n    border-radius: 6px;\n    text-transform: uppercase;\n    background: #fff;\n    color: #000;\n    text-decoration: none;\n    }\n    a.invoice-download-btn {\n    text-transform: uppercase;\n    padding: 8px 20px;\n    border: none ;\n    border-radius: 6px;\n    background: #000082;\n    color: #fff;\n    text-decoration: none;\n    }\n    .invoice-header-total {\n    margin-bottom: 20px;\n    border-bottom: 1px solid #dee2e6;\n    }\n    td.table-data-text {\n    padding:0px 10px !important;\n    }\n    .dl-horizontal dd {\n    margin-left: auto;\n    }\n    .invoice .panel{\n    margin-bottom: initial !important;\n    }\n    .invoice .panel-body {\n    padding-left: initial !important;\n    } \n    .invoice .panel > .panel-body + .table{\n    border-top: none;\n    }\n    .inv-footer .table-data-text, .fontszsm, .copytext{\n    font-size: 12px;\n    color: #808080;\n    }\n    .copytext{\n    text-align: center;\n    margin-top: 10px;\n    }\n    .pb-0{ padding-bottom: 0px; }\n    .mb-d{margin-bottom: 2px;}\n    .txtalign {text-align: right !important;}\n    .txtcenter {text-align: center !important;}\n    .tbldd dd {margin-bottom: 5px;}\n    .table-condensed-second > tbody > tr > td { padding-bottom: 3px !important; padding-bottom: 3px !important; }\n    .line1{ border-top: 1px solid #ea7227; width: 25%;}\n    .line2{ border-top: 1px solid #e63132; width: 25%;}\n    .line3{ border-top: 1px solid #4c9acc; width: 25%;}\n    .line4{ border-top: 1px solid #5fc752; width: 25%;}\n    </style>\n<div class=\"container invoice\">\n    <div class=\"invoice-body\">\n        <div class=\"invoiceheader\">\n            <div class=\"row\">\n                <div class=\"col-lg-12 col-md-12 col-sm-12\">\n                    <div class=\"panel panel-default \">\n                        <div class=\"panel-heading-img\"> <img src=\"assets/img/invoice_logo.png\" alt=\"Logo\" srcset=\"\"> </div>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <div class=\"invoice-content\">\n            <div class=\"row\">\n                <div class=\"col-sm-12\" style=\"padding-left:0px;\">\n                    <div class=\"panel panel-default\">\n                        <div class=\"panel-heading\">\n                            <p class=\"address-title\"> <span>Dosina Translations AS &middot; </span> <span>Munthes gate 42 &middot; </span> <span>0260</span> <span>Oslo &middot; </span>  <span>Norway</span> </p>\n                        </div>\n\n                        <div class=\"panel-body\" style=\"padding-top: 0px;\">\n                            <dl class=\"dl-horizontal\">\n                                <dd style=\"margin-bottom: 8px;\"><strong> [NAME2]  [NAME1] </strong></dd>\n                                <dd> [STREET1][STREET2] </dd>\n                                <dd> [POSTCODE] <span>[CITY]</span></dd>\n                                <dd> [COUNTRY] </dd>\n                        </div>\n                        <div class=\"panel-body\" style=\"padding-top: 0px;\">\n                        <!-- <dl class=\"dl-horizontal\"> -->\n                            <div class=\"col-sm-4\">\n                                <p class=\"mb-d\"><strong>Project Manager</strong></p>\n                                [PROJECT_MANAGER]\n                            </div>\n                            <div class=\"col-sm-4\">\n                                <p class=\"mb-d\"><strong>Email</strong></p> [EMAIL]\n                            </div>\n                            <div class=\"col-sm-4\">\n                                <p class=\"mb-d\"><strong>Date</strong></p> \n                                [ORDERDATE]\n                            </div>\n                        </div>\n                    </div>\n                </div>\n            </div>\n            <div class=\"row\">\n                <div class=\"panel panel-default invoice-header-height\">\n                    <div class=\"panel-body\">\n                        <dl class=\"dl-horizontal\" style=\"padding: 0 15px;\">\n                            <dd class=\"invoice-heading\"><strong>Purchase Order | [JOBNO] </strong></dd>\n                    </div>\n                </div>\n            </div>        \n            <div class=\"row\">\n                <div class=\"panel panel-default invoice-header-height\">\n                    <div class=\"row\">\n                        <div class=\"col-lg-12 col-md-12 col-sm-12\">\n                            <div class=\"panel panel-default\">\n                                <div class=\"panel-body\">\n                                    <div class=\"col-sm-12\" style=\"margin-bottom: 10px;font-size:16px;\">\n                                        <p>Thank you so much for helping us with the following project:</p>\n                                    </div>\n\n                                    <dl class=\"dl-horizontal tbldd\">\n                                        <dd> <strong> Project: </strong> [PROJECTNAME] </dd>\n                                        <dd> <strong> Client: </strong> [INDIRECT_CUSTOMER] </dd>\n                                        <dd> <strong> Task: </strong> [TASKNAME] </dd>\n                                        <dd> <strong> Languages: </strong> [LANGUAGES] </dd>\n                                        <dd> <strong> Instructions: </strong> [INSTRUCTIONS] </dd>\n                                        <dd> <strong> Deadline: </strong> <span style=\"color:red\"> [DEADLINE] </span> </dd>\n                                        <dd> <strong> Company to invoice: </strong> Dosina Translations AS </dd>\n                                        <dd> <strong> Word Count: </strong> [WORDCOUNT] </dd>\n                                        <dd> <strong> Total: </strong> [TOTALPRICE] </dd>\n                                </div>\n                            </div>\n                        </div>\n                    </div>\n                </div>\n            </div>        \n            <div class=\"row\">\n                <div class=\"panel panel-default invoice-header-height\" style=\"text-align:center;\">\n                    <p class=\"fontszsm\"> \n                    Please make sure to state the following project number [JOBNO] on your invoice and remember to invoice the following company: Dosina Translations AS.\n                    Please send all invoices to accounting@dosinatranslations.no </p>\n                    <p class=\"fontszsm\"> \n                    Please also note that all work done for Dosina Translations AS are regulated under the same conditions as you have agreed with BeConnected,\n                    including signed NDA and Service Agreement.\n                    </p>\n                </div>\n            </div>  \n        </div> \n        <div class=\"invoicefooter\">\n            <div class=\"row\">\n                <div class=\"panel panel-default invoice-header-height\" style=\"margin: 0 15px;\">        \n                    <div class=\"d-flex\">\n                    <div class=\"line1\"> </div>\n                    <div class=\"line2\"> </div>\n                    <div class=\"line3\"> </div>\n                    <div class=\"line4\"> </div>\n                    </div>\n                    <table class=\"table table-bordered table-condensed inv-footer\" style=\"margin-top: 10px;\">\n                        <tbody>\n                            <tr>\n                                <td class=\"table-data-text\"> <strong> Dosina Translations AS </strong> </td>\n                                <td class=\"table-data-text\"> </td>\n                                <td class=\"table-data-text txtalign\"> <strong> VAT NUMBER:</strong> </td>\n                            </tr>\n                            <tr>\n                                <td class=\"table-data-text\"> Munthes gate 42 </td>\n                                <td class=\"table-data-text txtcenter\"> Email:<a href=\"mailto:accounting@dosinatranslations.no\"> accounting@dosinatranslations.no </a> </td>\n                                <td class=\"table-data-text txtalign\">Foretaksregisteret: </td>\n                            </tr>\n                            <tr>\n                                <td class=\"table-data-text\"> 0260 Oslo </td>\n                                <td class=\"table-data-text\">  </td>\n                                <td class=\"table-data-text txtalign\">NO922694788</td>\n                            </tr>\n                            <tr>\n                                <td class=\"table-data-text\"> Norway </td>\n                                <td class=\"table-data-text\"> </td>\n                                <td class=\"table-data-text\"> </td>\n                            </tr>\n                        </tbody>\n                    </table>\n                    <div>\n                        <p class=\"copytext\" > <spam style=\"font-family:Arial Unicode MS;\"> &copy; </spam> Dosina Translations AS 2019. All rights reserved. </p>\n                    </div>\n                </div>\n            </div>\n        </div>    \n    </div>\n</div>', 'Purchase Order PDF', 9, 1, 1, '2023-06-05 15:40:00', '2023-06-13 16:33:33');
